local function toTimestamp(d)
    return time({ year = d.year, month = d.month, day = d.day, hour = 0 })
end

function SpellCore:IsKeyValid()
    if self._validated then return true end

    if not SpellCoreProductKey or SpellCoreProductKey == "" then
        print("|cffff0000[SpellCore] No key detected. Use /spellcorekey to register one.|r")
        return false
    end

    local reversed = SpellCoreProductKey:reverse()
    local keyData = validKeys[reversed]
    if not keyData then
        print("|cffff0000[SpellCore] Invalid key. Use /spellcorekey to re-enter a valid one.|r")
        return false
    end

    self.KeyType = keyData.keyType or "lite"

    if keyData.lifetime then
        print(string.format("|cff00ff00[SpellCore] Access granted. Eternal license activated (%s).|r", self.KeyType))
        self._validated = true
        return true
    end

    local now = time()
    local startTime = toTimestamp(keyData.start)
    local endTime = toTimestamp(keyData.stop) + 86399

    if now >= startTime and now <= endTime then
        local remaining = endTime - now
        local days = math.floor(remaining / 86400)
        local hours = math.floor((remaining % 86400) / 3600)
        local minutes = math.floor((remaining % 3600) / 60)
        print(string.format("|cff00ff00[SpellCore] Key active. Remaining: %d day(s), %d hour(s), %d min (%s).|r", days, hours, minutes, self.KeyType))
        self._validated = true
        return true
    else
        print("|cffff0000[SpellCore] Key expired. Renew required.|r")
        return false
    end
end

