function SpellCore:LoadRotationContext(context)
    local spec = GetSpecNameByID(self.specID)
    if not spec then
        print("SpellCore: Unknown specialization.")
        return
    end

    local key = self.class .. "_" .. spec .. "_" .. context:upper()
    if SpellCoreRotations[key] then
        SpellCoreRotations[key]()
        self.currentContext = context:upper()
        local charKey = UnitName("player") .. "-" .. GetRealmName()
        SpellCoreSaved[charKey] = self.currentContext
        print("SpellCore: Loaded rotation → " .. key)
    else
        print("SpellCore: No rotation found for → " .. key)
    end
end

local frame = CreateFrame("Frame")
frame:RegisterEvent("PLAYER_LOGIN")
frame:RegisterEvent("PLAYER_TALENT_UPDATE")
frame:RegisterEvent("ACTIVE_TALENT_GROUP_CHANGED")
frame:SetScript("OnEvent", function(self, event, ...)
    if not SpellCore:IsKeyValid() then
        print("|cffff0000[SpellCore] Addon access denied. Enter a valid key with /spellcorekey.|r")
        return
    end

    if event == "PLAYER_LOGIN" or event == "PLAYER_TALENT_UPDATE" or event == "ACTIVE_TALENT_GROUP_CHANGED" then
        SpellCore.class = select(2, UnitClass("player"))
        local specIndex = GetSpecialization()
        if specIndex then
            SpellCore.specID = GetSpecializationInfo(specIndex)
        end

        if not SpellCore.specID then
            print("SpellCore: Unable to determine specialization.")
            return
        end

        local charKey = UnitName("player") .. "-" .. GetRealmName()
        local savedContext = SpellCoreSaved[charKey] or "OPENWORLD"
        SpellCore:LoadRotationContext(savedContext)
    end

    -- Slash command registration stays outside event check
    SLASH_SPELLCORERUN1 = "/scrun"
    SlashCmdList["SPELLCORERUN"] = function()
        if SpellCore and SpellCore.RunRotation then
            SpellCore:RunRotation()
        end
    end

    SLASH_SPELLCOREAUTO1 = "/spellcoreauto"
    SlashCmdList["SPELLCOREAUTO"] = function()
        if SpellCore.KeyType == "pro" then
            SpellCore:ToggleAutoCast()
        else
            print("|cffff0000[SpellCore] Auto-cast is only available with a Pro key.|r")
        end
    end
end)

function SpellCore:ToggleAutoCast()
    autoCastingSpellCore = not autoCastingSpellCore
    print(autoCastingSpellCore and "|cff00ff00[SpellCore] Auto-cast enabled.|r" or "|cffff0000[SpellCore] Auto-cast disabled.|r")

    local function loop()
        if not autoCastingSpellCore then return end
        if SpellCore and SpellCore.RunRotation then
            SpellCore:RunRotation()
        end
        C_Timer.After(math.random(10, 30) / 100, loop)
    end

    if autoCastingSpellCore then loop() end
end

